import React from 'react';
import './HomePage.css'; // Import the CSS file for the home page styles

const Home = () => {
  return (
    <div className="home-page">
      {/* Header */}
      <header className="header">
        <nav>
          <h1>Metal Supplier</h1>
          {/* Add navigation links here */}
        </nav>
      </header>

      {/* Hero Section */}
      <section className="hero">
        <div className="hero__content">
          <h2>Quality Metal Supplies</h2>
          <p>Your trusted source for high-quality metal products.</p>
          {/* Add a call-to-action button here */}
        </div>
      </section>

      {/* Services or Products Section */}
      <section className="services">
        <h2>Our Services</h2>
        {/* Add service or product cards here */}
      </section>

      {/* About Us Section */}
      <section className="about">
        <h2>About Us</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer pretium libero vitae justo eleifend cursus.
        </p>
      </section>

      {/* Contact Section */}
      <section className="contact">
        <h2>Contact Us</h2>
        {/* Add a contact form or contact information here */}
      </section>

      {/* Footer */}
      <footer className="footer">
        {/* Add footer content here */}
      </footer>
    </div>
  );
};

export default Home;
